import React from 'react';

function CurrentTheme() {
    return (
      <div className="games-section">
                          <p>Current theme</p>
        <div className="current-theme">
        <img src="images/themeimage.jpeg" width="100%" alt="Game Image" />
        </div>
      </div>
    );
  }

  export default CurrentTheme;
